import React from "react";

export default function ImagesGrid(props) {
  console.log(props.images);
  if (props.images) {
    return (
      <div className='imagesGrid'>
        {props.images.map(function (image, index) {
          return <img src={image.src.tiny} alt='' key={index} />;
        })}
      </div>
    );
  } else {
    return null;
  }
}
